import React from 'react';
import style from "./NavBar.module.css";

function NavBar(){
    return (
        <div className={style.container}>
        <div>
            <img src="" alt="" />
        </div>
        <div>
           <ul>
                <li>Home</li>
                <li>Nueva Receta</li>
                <li>Proyecto</li>
           </ul>
        </div>
        </div>
    )
}


export default NavBar;
